/**
 * File Description: This component is the left pane of the website to display the results of search
 * Author(s): Sashank Pindiproli
 * Date of Creation: 02/02/2020
 */

import React from 'react';
import styled from 'styled-components';
import { Dropdown } from 'react-bootstrap';

/** SAMPLE JSON: const data = [
    { name: '1', value: 1, onClick: () => doSomething2() },
    { name: '2', value: 2, onClick: () => doSomething2() },
    { name: '3', value: 3, onClick: () => doSomething3() },
  ]; */
const DropdownComponent = ({ data }) => {
  return (
    <Dropdown>
      <Dropdown.Toggle variant="light" id="dropdown-basic">
        Dropdown Button
      </Dropdown.Toggle>

      <Dropdown.Menu>
        <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
        <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
        <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  );
};

export default DropdownComponent;
